import logo from '../assets/logo.svg'
const Navbar = () => {
  return (
    <div>
      <div>
        <img src={logo} alt="logo" />
      </div>
      <div>
        <p>Home</p>
        
      </div>
    </div>
  );
};

export default Navbar;
